import React, {Component} from 'react';
import axios from 'axios';
import { Jumbotron, Col, Card, CardTitle, CardText } from 'reactstrap';
import {registerUser} from './userfunctions'

export default class Userregisteration extends Component {
    constructor(props) {
        super(props);

        this.onChangeFullName = this.onChangeFullName.bind(this);
        this.onChangeOfficeID = this.onChangeOfficeID.bind(this);
        this.onChangeID = this.onChangeID.bind(this);
        this.onChangeKey = this.onChangeKey.bind(this);

        this.onSubmit = this.onSubmit.bind(this);

        this.state = {
            FullName: '',
            OfficeID: '',
            ID: '',
            Key:''
        }
    }

    onChangeID(e) {
        this.setState({
            ID: e.target.value
        });
    }

    onChangeKey(e) {
        this.setState({
            Key: e.target.value
        });
    }

    onChangeFullName(e) {
        this.setState({
            FullName: e.target.value
        });
    }

    onChangeOfficeID(e) {
        this.setState({
            OfficeID: e.target.value
        });
    }

    onSubmit(e) {
        e.preventDefault();

        console.log(`Form submitted:`);
        console.log(`FullName: ${this.state.FullName}`);
        console.log(`OfficeID: ${this.state.OfficeID}`);
        console.log(`ID: ${this.state.ID}`);
        console.log(`Key: ${this.state.Key}`);

        const newUser = {
            FullName: this.state.FullName,
            OfficeID: this.state.OfficeID,
            ID: this.state.ID,
            Key: this.state.Key
        }

        registerUser(newUser).then(res => {
            this.props.history.push(`/adminlogin`)
          })
    }

    render() {
        return (
            <div class='container'>
                <Jumbotron>
                    <h1 className="display-3">Admin Registration</h1>
                        <p className="lead">Provides below information to be registered yourself.</p>
                        <hr className="my-2" />
                        <p className="lead">
                        </p>
                    </Jumbotron>
                    <Col sm='12'>
                        <Card body>
                            <CardTitle><b><h3>Provides below information</h3></b></CardTitle>
                                <CardText> 
                                <form onSubmit={this.onSubmit}>
                                    <div className="form-group">
                                        <label>Full Name:</label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.FullName}
                                                onChange={this.onChangeFullName}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <label>OfficeID:</label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.OfficeID}
                                                onChange={this.onChangeOfficeID}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <label>ID:</label>
                                        <input  type="text"
                                                className="form-control"
                                                value={this.state.ID}
                                                onChange={this.onChangeID}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <label>Key: </label>
                                        <input  type="Password"
                                                className="form-control"
                                                value={this.state.Key}
                                                onChange={this.onChangeKey}
                                                />
                                    </div>
                                    <div className="form-group">
                                        <button type="submit" value="Register" className="btn btn-primary">Register</button>
                                    </div>
                                </form>
                                </CardText>
                        </Card>                        
                    </Col>
            </div>
        )
    }
}
